		String str2;
		boolean expect;
		boolean output;

		str1 = "egg";
		str2 = "add";
		expect = true;
		output = s.isIsomorphic(str1, str2);
		assert (output == expect) : "1:wrong";

		str1 = "foo";
		str2 = "bar";
		expect = false;
		output = s.isIsomorphic(str1, str2);
		assert (output == expect) : "2:wrong";

		str1 = "paper";
		str2 = "title";
